import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        <header>
          <section>
            <div className="logo">
              <img src="../images/atruity_logo.png"/>
            </div>
            <ul className="main-menu">
              <li>Build</li>
              <li>Assess</li>
            </ul>
          </section>
          <section>
            <ul className="tools-menu">
              <li>Reports</li>
              <li>Toolkit</li>
              <li>Team Boards</li>
              <li><i class="fas fa-user-circle"></i></li>
            </ul>
          </section>
        </header>
      </div>
    );
  }
}

export default App;
